import React from 'react';
import './css/header.css';
import {
    Link as Linkto
} from 'react-router-dom';

const Header = () => {

    return (

        <
        header >
        <
        nav id = "nav" >
        <
        h1 id = "h1" > Ayam Berkokok < /h1> <
        ul >
        <
        li > < Linkto to = "movie/tablemovie" > Table Movie < /Linkto></li >
        <
        /ul> <
        /nav> <
        /header>
    )
}
export default Header;
